CREATE TABLE alternativas (
    id_unico_a            VARCHAR2(5) NOT NULL,
    descripcion_a         VARCHAR2(250),
    valor_a               CHAR(1),
    peso_a                VARCHAR2(3),
    preguntas_id_unico_p  VARCHAR2(5) NOT NULL
);

ALTER TABLE alternativas ADD CONSTRAINT alternativas_pk PRIMARY KEY ( id_unico_a );

CREATE TABLE curso (
    id_unico_c VARCHAR2(25) NOT NULL
);

ALTER TABLE curso ADD CONSTRAINT curso_pk PRIMARY KEY ( id_unico_c );

CREATE TABLE estudiantes (
    nombre_e          VARCHAR2(25) NOT NULL,
    apellido_p_e      VARCHAR2(25),
    apellido_m_e      VARCHAR2(25),
    curso_id_unico_c  VARCHAR2(25) NOT NULL
);

ALTER TABLE estudiantes ADD CONSTRAINT alumnos_pk PRIMARY KEY ( nombre_e );

CREATE TABLE preguntas (
    id_unico_p       VARCHAR2(5) NOT NULL,
    enunciado_p      VARCHAR2(150),
    puntaje_p        VARCHAR2(5),
    test_id_unico_t  VARCHAR2(5) NOT NULL
);

ALTER TABLE preguntas ADD CONSTRAINT preguntas_pk PRIMARY KEY ( id_unico_p );

CREATE TABLE respuestas (
    estudiantes_nombre_e     VARCHAR2(25) NOT NULL,
    preguntas_id_unico_p     VARCHAR2(5) NOT NULL,
    alternativas_id_unico_a  VARCHAR2(5) NOT NULL,
    respuesta_e              CHAR(1) NOT NULL
);

ALTER TABLE respuestas ADD CONSTRAINT respuesta_pk PRIMARY KEY ( respuesta_e );

CREATE TABLE test (
    id_unico_t        VARCHAR2(5) NOT NULL,
    nombre_t          VARCHAR2(25),
    descripcion_t     VARCHAR2(150),
    programa_t        VARCHAR2(25),
    autor_t           VARCHAR2(25),
    fecha_t           DATE,
    curso_id_unico_c  VARCHAR2(25) NOT NULL
);

ALTER TABLE test ADD CONSTRAINT test_pk PRIMARY KEY ( id_unico_t );

ALTER TABLE alternativas
    ADD CONSTRAINT alternativas_preguntas_fk FOREIGN KEY ( preguntas_id_unico_p )
        REFERENCES preguntas ( id_unico_p );

ALTER TABLE estudiantes
    ADD CONSTRAINT estudiantes_curso_fk FOREIGN KEY ( curso_id_unico_c )
        REFERENCES curso ( id_unico_c );

ALTER TABLE preguntas
    ADD CONSTRAINT preguntas_test_fk FOREIGN KEY ( test_id_unico_t )
        REFERENCES test ( id_unico_t );

ALTER TABLE respuestas
    ADD CONSTRAINT respuestas_alternativas_fk FOREIGN KEY ( alternativas_id_unico_a )
        REFERENCES alternativas ( id_unico_a );

ALTER TABLE respuestas
    ADD CONSTRAINT respuestas_estudiantes_fk FOREIGN KEY ( estudiantes_nombre_e )
        REFERENCES estudiantes ( nombre_e );

ALTER TABLE respuestas
    ADD CONSTRAINT respuestas_preguntas_fk FOREIGN KEY ( preguntas_id_unico_p )
        REFERENCES preguntas ( id_unico_p );

ALTER TABLE test
    ADD CONSTRAINT test_curso_fk FOREIGN KEY ( curso_id_unico_c )
        REFERENCES curso ( id_unico_c );






















































